import styled from "styled-components";

const Container = styled.div``;
const Features = styled.div``;
const FeaturesItem = styled.div``;

const Featured = () => {
  return (
    <Container>
      <Features>
        <FeaturesItem></FeaturesItem>
      </Features>
    </Container>
  )
}

export default Featured
